import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import ProtectedRoute from "./router/ProtectedRoute";
import MainPage from "./router/MainPage";
import RecipePage from "./router/RecipePage";
import LoginPage from "./router/LoginPage";
import NotFound from "./router/NotFound";
import SignUpPage from "./router/SignUpPage";
import Logincom from "./router/LoginCom";
import ProfilePage from "./router/ProfilePage"
import { GoogleOAuthProvider } from "@react-oauth/google";

function App() {
  return (
    <GoogleOAuthProvider clientId={process.env.REACT_APP_GOOGLE}>
      <Router>
        <Routes>
          {/* 로그인 없이 접근 가능한 페이지 */}
          <Route path="/budda" element={<MainPage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/login/signup" element={<SignUpPage />} />
          <Route path="*" element={<NotFound />} />

          {/* 로그인해야 접근 가능한 페이지 */}
          <Route
            path="/login/com"
            element={
              <ProtectedRoute>
                <Logincom />
              </ProtectedRoute>
            }
          />
          <Route
            path="/recipe"
            element={
              <ProtectedRoute>
                <RecipePage />
              </ProtectedRoute>
            }
          />
          <Route
            path="/profile"
            element={
              <ProtectedRoute>
                <ProfilePage />
              </ProtectedRoute>
            }
          />
        </Routes>
      </Router>
    </GoogleOAuthProvider>
  );
}

export default App;
